Brukeren skal utstyre programvaren og funksjonene til programvaren (inkludert, men ikke begrenset til, å opprette nye forekomster) med maskinvare- og programvarekonfigurasjonen som kreves av brukeren.
Brukere skal være ansvarlige for de relevante telefon- og bredbåndsbruksavgiftene som må betales etter tilkobling til Internett.
Brukeren skal bære det juridiske ansvaret for oppførselen, hendelsen og resultatet forårsaket av bruken av denne programvaren.
Eventuelle transaksjoner og tvister mellom brukere og andre uautoriserte uoffisielle personer har ingenting med utvikleren å gjøre.
Brukeren skal overholde relevante lover og forskrifter i Folkerepublikken Kina (hvis brukeren er en bruker utenfor Folkerepublikken Kina, skal brukeren også overholde lovene og forskriftene i landet eller regionen den tilhører).
Brukeren skal ikke bruke programvaren (eller noen funksjoner og funksjoner i programvaren) til å delta i ulovlige handlinger, og skal ikke bruke de relevante prosessene og tjenestene knyttet til programvaren til å delta i ulovlige handlinger, og konsekvensene av eventuelle handlinger skal ikke være relatert til utvikleren.
Brukere skal bære sitt eget juridiske ansvar knyttet til innholdet i informasjonen de publiserer. Brukeren skal ikke legge inn, publisere eller spre noe av følgende innhold i programvaren, prosessene og tjenestene knyttet til driften av programvaren, og skal ikke publisere noe av følgende innhold i noen form：

motsette seg de grunnleggende prinsippene som er fastsatt i Folkerepublikken Kinas grunnlov;
sette nasjonal sikkerhet i fare, avsløre statshemmeligheter, undergrave statsmakt eller undergrave nasjonal enhet;
skade statens ære og interesser;
oppfordre til etnisk hat, etnisk diskriminering eller undergrave etnisk enhet;
undergraving av nasjonal religiøs politikk, forfekting av kulter og føydal overtro;
spre rykter, forstyrre sosial orden eller undergrave sosial stabilitet;
Spredning av uanstendighet, pornografi, gambling, vold, drap, terror eller oppfordring til forbrytelser;
fornærme eller bakvaske andre, krenke andres lovlige rettigheter og interesser;
Inneholder annet innhold som Folkerepublikken Kina har forbudt i henhold til lover eller administrative forskrifter.
Med mindre det er tillatt ved lov eller med skriftlig tillatelse fra utvikleren, skal brukere ikke delta i noen av følgende handlinger：
Ulovlig eller upassende bruk av programvaren og tjenestene;
Skade den normale driften av programvaresystemet eller nettstedet, bevisst spre datavirus og andre destruktive programmer;
Ta enhver unormal bruksatferd som kan påvirke nettverkstjenestene til programvaren (inkludert, men ikke begrenset til, skade, angripe serveren eller overbelaste serveren, etc.);
Slett opphavsrettsinformasjonen på programvaren og dens kopier.

Hvis brukeren begår atferd som bryter lover og forskrifter eller bryter med bestemmelsene i denne avtalen, har utvikleren rett til å iverksette tiltak mot brukeren i henhold til alvorlighetsgraden av situasjonen, i samsvar med denne avtalen og lover og forskrifter, inkludert, men ikke begrenset til, oppsigelse av tjenester. Hvis omstendighetene er alvorlige, vil de bli overført til de aktuelle forvaltningsorganene for administrativ straff eller etterforsket for straffansvar.

Hvis du godtar disse bruksvilkårene og bruker de elektroniske tjenestene til programvaren, vil vi samle inn følgende informasjon：
IP-adressen til enheten som programvaren kjører på (som kanskje ikke er riktig adresse);
Noe systeminformasjon om utstyret som programvaren opererer på;
Når programvaren krasjer, kan loggene til programvaren som kjører på systemet (inkludert noe systeminformasjon) lastes opp med brukerens samtykke for å bidra til å løse problemet og forbedre programvaren.
Annen informasjon som vil bli lastet opp med samtykke fra brukeren (som spesifisert i programvaren).

1. Suspensjon og oppsigelse av brukerens tjeneste

Hvis brukeren publiserer ulovlig informasjon, alvorlig bryter sosial moral eller bryter lovens forbud, skal utvikleren avslutte leveringen av tjenester til brukeren;
Hvis brukeren begår en upassende handling når han godtar programvaretjenesten, har utvikleren rett til å avslutte tjenesten som er levert til brukeren (de spesifikke omstendighetene for den upassende oppførselen er tydelig angitt i denne avtalen);
Hvis brukeren bruker en modifisert versjon av programvaren fra en tredjepart, skal brukeren bære sin egen risiko og sitt juridiske ansvar.

2. Suspensjon, suspensjon og oppsigelse av programvaren og tjenestene：

I tilfelle noen av følgende omstendigheter, har utvikleren rett til å avslutte eller avbryte hele eller deler av tjenestene til programvaren, og utvikleren skal ikke være ansvarlig overfor brukeren eller noen tredjepart for ulempen eller skaden forårsaket av dette：

a. som påkrevd av programvaren og tjenestene;
b. Manglende funksjon på grunn av skade på serveren;
c. På grunn av plutselig svikt i programvare- og maskinvareutstyr og elektronisk kommunikasjonsutstyr;
d. på grunn av nettverksleverandørlinje eller andre feil;
e. på grunn av politiske hensyn;
f. Tredjeparts årsaker eller andre force majeure-omstendigheter.

Utvikleren forbeholder seg retten til å avslutte eller delvis avslutte programvaren og tjenestene når den anser det nødvendig, og utvikleren kan varsle brukeren i form av en kunngjøring, men utvikleren skal ikke være ansvarlig for eventuelle tap påført brukeren.

Denne avtalen skal styres av Folkerepublikken Kinas lover, uten hensyn til alle lovvalgsregler;
Utbyggerens unnlatelse av å utøve, unnlate å utøve i tide eller fullt ut utøve rettighetene i henhold til denne avtalen eller i samsvar med loven, skal ikke anses å være en fraskrivelse av utøvelsen av slike rettigheter, og det skal heller ikke påvirke utbyggerens utøvelse av slike rettigheter i fremtiden;
I den grad loven tillater det, har utvikleren rett til å tolke vilkårene i denne avtalen;
Brukere kan klage og rapportere alle slags brudd på lover og forskrifter via e-post, vennligst send e-posten til services@mcsl.com.cn.
